0435\u0433\u043e \u043f\u043e\u0441\u0435\u0442\u0438\u043b\u0438 \u0446\u0430\u0440\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B5%D0%B9_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0410\u043b\u0435\u043a\u0441\u0435\u0439 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447\">\u0410\u043b\u0435\u043a\u0441\u0435\u0439 \u041c\u0438\u0445\u0430\u0439\u043b\u043e\u0432\u0438\u0447<\/a> \u0438 \u043a\u043d\u044f\u0437\u044c \u0418.&#160;\u0410.&#160;\u0412\u043e\u0440\u043e\u0442\u044b\u043d\u0441\u043a\u0438\u0439, \u043f\u044b\u0442\u0430\u0432\u0448\u0438\u0435\u0441\u044f \u043f\u0440\u0438\u043c\u0438\u0440\u0438\u0442\u044c \u043f\u0440\u043e\u0442\u043e\u043f\u043e\u043f\u0430 \u0441 \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0439 \u0446\u0435\u0440\u043a\u043e\u0432\u044c\u044e. \u0411\u043e\u043b\u0435\u0435 \u0433\u043e\u0434\u0430 \u0410\u0432\u0432\u0430\u043a\u0443\u043c\u0430 \u0438 \u0435\u0433\u043e \u0441\u0442\u043e\u0440\u043e\u043d\u043d\u0438\u043a\u043e\u0432 \u043f\u0435\u0440\u0435\u0432\u043e\u0437\u0438\u043b\u0438 \u0438\u0437 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044f \u0432 \u043c\u043e\u043d\u0430\u0441\u0442\u044b\u0440\u044c, \u0446\u0435\u0440\u043a\u043e\u0432\u043d\u044b\u0435 \u0438\u0435\u0440\u0430\u0440\u0445\u0438 \u0432\u0435\u043b\u0438 \u0441 \u043d\u0438\u043c \u0441\u043f\u043e\u0440\u044b, \u043d\u043e \u043e\u043d \u043e\u0441\u0442\u0430\u043b\u0441\u044f \u043d\u0435\u043f\u0440\u0435\u043a\u043b\u043e\u043d\u043d\u044b\u043c. \u0412 \u0438\u044e\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1667\" class=\"mw-redirect\" title=\"1667\">1667<\/a> \u0432\u0441\u0435\u0445 \u00ab\u0440\u0430\u0441\u043a\u043e\u043b\u043e\u0443\u0447\u0438\u0442\u0435\u043b\u0435\u0439\u00bb \u043e\u0441\u0443\u0434\u0438\u043b\u0438 \u043d\u0430 \u0426\u0435\u0440\u043a\u043e\u0432\u043d\u043e\u043c \u0441\u043e\u0431\u043e\u0440\u0435 \u0438 \u043f\u0440\u0435\u0434\u0430\u043b\u0438 \u0430\u043d\u0430\u0444\u0435\u043c\u0435. \u0410\u0432\u0432\u0430\u043a\u0443\u043c\u0430 \u0441\u043e\u0441\u043b\u0430\u043b\u0438 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%83%D1%81%D1%82%D0%BE%D0%B7%D0%B5%D1%80%D1%81%D0%BA\" title=\"\u041f\u0443\u0441\u0442\u043e\u0437\u0435\u0440\u0441\u043a\">\u041f\u0443\u0441\u0442\u043e\u0437\u0435\u0440\u0441\u043a<\/a>, \u0447\u0435\u0440\u0435\u0437 \u0442\u0440\u0438 \u0433\u043e\u0434\u0430 \u043f\u043e\u0441\u0430\u0434\u0438\u043b\u0438 \u0432 \u00ab\u0437\u0435\u043c\u043b\u044f\u043d\u0443\u044e \u0442\u044e\u0440\u044c\u043c\u0443\u00bb, \u0430 \u0432 \u0430\u043f\u0440\u0435\u043b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1682\" class=\"mw-redirect\" title=\"1682\">1682<\/a> \u043f\u043e \u043f\u0440\u0438\u0433\u043e\u0432\u043e\u0440\u0443 \u0441\u043e\u0431\u043e\u0440\u0430 \u0437\u0430\u0436\u0438\u0432\u043e \u0441\u043e\u0436\u0433\u043b\u0438 \u0432 \u0441\u0440\u0443\u0431\u0435.<\/li><\/ul><h3>XVIII \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1731\" class=\"mw-redirect\" title=\"1731\">1731<\/a>&#160;\u2014 \u043e\u0442\u043a\u0440\u044b\u0442\u043e \u0441\u0443\u0434\u043e\u0445\u043e\u0434\u0441\u0442\u0432\u043e \u043f\u043e \u041b\u0430\u0434\u043e\u0436\u0441\u043a\u043e\u043c\u0443 \u043a\u0430\u043d\u0430\u043b\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1734\" class=\"mw-redirect\" title=\"1734\">1734<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B7%D0%B0_%D0%BF%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0437\u0430 \u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0435 \u043d\u0430\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u043e\">\u0412\u043e\u0439\u043d\u044b \u0437\u0430 \u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0435 \u043d\u0430\u0441\u043b\u0435\u0434\u0441\u0442\u0432\u043e<\/a> \u043d\u0430 \u0438\u0442\u0430\u043b\u044c\u044f\u043d\u0441\u043a\u043e\u043c \u0442\u0435\u0430\u0442\u0440\u0435 \u0431\u043e\u0435\u0432\u044b\u0445 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0439 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B8%D1%82%D0%B2%D0%B0_%D0%BF%D1%80%D0%B8_%D0%91%D0%B8%D1%82%D0%BE%D0%BD%D1%82%D0%BE\" title=\"\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0411\u0438\u0442\u043e\u043d\u0442\u043e\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0411\u0438\u0442\u043e\u043d\u0442\u043e<\/a>, \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0438\u0441\u043f\u0430\u043d\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430, \u0432\u043e\u0437\u0433\u043b\u0430\u0432\u043b\u044f\u0435\u043c\u044b\u0435 <a href=\"https:\/\/es.wikipedia.org\/wiki\/Jos%C3%A9_Carrillo_de_Albornoz\" class=\"extiw\" title=\"es:Jos\u00e9 Carrillo de Albornoz\">\u0433\u0440\u0430\u0444\u043e\u043c \u041c\u043e\u043d\u0442\u0435\u043c\u0430\u0440<\/a>, \u043f\u043e\u043b\u043d\u043e\u0441\u0442\u044c\u044e \u0440\u0430\u0437\u0433\u0440\u043e\u043c\u0438\u043b\u0438 \u0430\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u0438\u0435 \u0432\u043e\u0439\u0441\u043a\u0430.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1779\" class=\"mw-redirect\" title=\"1779\">1779<\/a>&#160;\u2014 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435 \u043e\u0442\u043a\u0440\u044b\u043b\u043e\u0441\u044c \u043c\u0435\u0436\u0435\u0432\u043e\u0435 \u0443\u0447\u0438\u043b\u0438\u0449\u0435, \u043a\u043e\u0442\u043e\u0440\u043e\u0435 \u0431\u044b\u043b\u043e \u043d\u0430\u0437\u0432\u0430\u043d\u043e \u0432 \u0447\u0435\u0441\u0442\u044c \u0432\u043d\u0443\u043a\u0430 \u0415\u043a\u0430\u0442\u0435\u0440\u0438\u043d\u044b II \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u0430. <a href=\"ht