ass=\"extiw\" title=\"es:Real Audiencia de Charcas\">\u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u043e\u0439 \u0430\u0443\u0434\u0438\u0435\u043d\u0446\u0438\u0438 \u0427\u0430\u0440\u043a\u0430\u0441<\/a> \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0432\u043e\u0441\u0441\u0442\u0430\u043d\u0438\u0435&#160;\u2014 <a href=\"https:\/\/es.wikipedia.org\/wiki\/Revoluci%C3%B3n_de_Chuquisaca\" class=\"extiw\" title=\"es:Revoluci\u00f3n de Chuquisaca\">\u0420\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f \u0427\u0443\u043a\u0438\u0441\u0430\u043a\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1810\" class=\"mw-redirect\" title=\"1810\">1810<\/a>&#160;\u2014 \u0432 \u0432\u0438\u0446\u0435-\u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BE-%D0%B4%D0%B5-%D0%BB%D0%B0-%D0%9F%D0%BB%D0%B0%D1%82%D0%B0_(%D0%B2%D0%B8%D1%86%D0%B5-%D0%BA%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D1%82%D0%B2%D0%BE)\" title=\"\u0420\u0438\u043e-\u0434\u0435-\u043b\u0430-\u041f\u043b\u0430\u0442\u0430 (\u0432\u0438\u0446\u0435-\u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u0442\u0432\u043e)\">\u0420\u0438\u043e-\u0434\u0435-\u043b\u0430-\u041f\u043b\u0430\u0442\u0430<\/a> (\u043f\u0440\u0435\u0434\u0448\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u0438\u043a \u0441\u043e\u0432\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%B3%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%B0\" title=\"\u0410\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u0430\">\u0410\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u044b<\/a>) \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B0%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F\" title=\"\u041c\u0430\u0439\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f\">\u041c\u0430\u0439\u0441\u043a\u0430\u04