0433\u043a\u043e\u0439 \u0430\u0442\u043b\u0435\u0442\u0438\u043a\u0435<\/a>. \u0412 \u043f\u0440\u044b\u0436\u043a\u0430\u0445 \u0432 \u0434\u043b\u0438\u043d\u0443, \u0433\u0434\u0435 \u041e\u0443\u044d\u043d\u0441 \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u0435\u043e\u0434\u043e\u043b\u0435\u043b \u0440\u0443\u0431\u0435\u0436 8&#160;\u043c, \u0435\u0433\u043e \u0440\u0435\u043a\u043e\u0440\u0434 \u043f\u0440\u043e\u0434\u0435\u0440\u0436\u0430\u043b\u0441\u044f 25 \u043b\u0435\u0442.<\/li><li>\u0423\u043f\u0440\u0430\u0437\u0434\u043d\u0435\u043d\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D1%80%D1%8B%D0%B5_%D0%B1%D0%BE%D0%BB%D1%8C%D1%88%D0%B5%D0%B2%D0%B8%D0%BA%D0%B8\" title=\"\u0421\u0442\u0430\u0440\u044b\u0435 \u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u0438\">\u041e\u0431\u0449\u0435\u0441\u0442\u0432\u043e \u0441\u0442\u0430\u0440\u044b\u0445 \u0431\u043e\u043b\u044c\u0448\u0435\u0432\u0438\u043a\u043e\u0432<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1936_%D0%B3%D0%BE%D0%B4_%D0%B2_%D0%BA%D0%B8%D0%BD%D0%BE\" title=\"1936 \u0433\u043e\u0434 \u0432 \u043a\u0438\u043d\u043e\">1936<\/a>&#160;\u2014 \u043d\u0430 \u044d\u043a\u0440\u0430\u043d\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%A1%D0%A1%D0%A0\" class=\"mw-redirect\" title=\"\u0421\u0421\u0421\u0420\">\u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430<\/a> \u0432\u044b\u0448\u043b\u0430 \u043a\u0438\u043d\u043e\u043a\u043e\u043c\u0435\u0434\u0438\u044f \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%B8%D1%80%D0%BA_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC,_1936)\" title=\"\u0426\u0438\u0440\u043a (\u0444\u0438\u043b\u044c\u043c, 1936)\">\u0426\u0438\u0440\u043a<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1939\" class=\"mw-redirect\" title=\"1939\">1939<\/a>&#160;\u2014 \u043f\u0435\u0440\u0432\u044b\u0435 \u0432 \u0441\u0442\u0440\u0430\u043d\u0435 \