title=\"\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0430\">\u041e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u044f \u0430\u0444\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u0433\u043e \u0435\u0434\u0438\u043d\u0441\u0442\u0432\u0430<\/a> (\u041e\u0410\u0415). \u041f\u043e \u0440\u0435\u0448\u0435\u043d\u0438\u044e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9E%D0%9E%D0%9D\" class=\"mw-redirect\" title=\"\u041e\u041e\u041d\">\u041e\u041e\u041d<\/a> \u044d\u0442\u043e\u0442 \u0434\u0435\u043d\u044c \u043e\u0431\u044a\u044f\u0432\u043b\u0435\u043d \u0414\u043d\u0451\u043c \u043e\u0441\u0432\u043e\u0431\u043e\u0436\u0434\u0435\u043d\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B0\" title=\"\u0410\u0444\u0440\u0438\u043a\u0430\">\u0410\u0444\u0440\u0438\u043a\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1968\" class=\"mw-redirect\" title=\"1968\">1968<\/a>&#160;\u2014 \u0432 17 \u0447\u0430\u0441\u043e\u0432 40 \u043c\u0438\u043d\u0443\u0442, \u0437\u0430 20 \u043c\u0438\u043d\u0443\u0442 \u0434\u043e \u043d\u0430\u0447\u0430\u043b\u0430 \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u0438\u044f \u00ab\u0415\u0441\u0442\u044c \u043d\u0430 \u0441\u0432\u0435\u0442\u0435 \u041c\u043e\u0441\u043a\u0432\u0430\u00bb, \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B7%D1%80%D1%8B%D0%B2_%D0%B8_%D0%BF%D0%BE%D0%B6%D0%B0%D1%80_%D0%BD%D0%B0_%D1%81%D1%82%D0%B0%D0%B4%D0%B8%D0%BE%D0%BD%D0%B5_%C2%AB%D0%A2%D1%80%D1%83%D0%B4%D0%BE%D0%B2%D1%8B%D0%B5_%D1%80%D0%B5%D0%B7%D0%B5%D1%80%D0%B2%D1%8B%C2%BB\" title=\"\u0412\u0437\u0440\u044b\u0432 \u0438 \u043f\u043e\u0436\u0430\u0440 \u043d\u0430 \u0441\u0442\u0430\u0434\u0438\u043e\u043d\u0435 \u00ab\u0422\u0440\u0443\u0434\u043e\u0432\u044b\u0435 \u0440\u0435\u0437\u0435\u0440\u0432\u044b\u00bb\">\u0441\u0442\u0430\u0434\u0438\u043e\u043d\u0435 \u00ab\u0422\u0440\u0443\u0434\u043e\u0432\u044b\u0435 \u0440\u0435\u0437\u0435\u0440\u0432\u044b\u00bb<\/a> \u0432 \u0433. <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D1%80%D0%BE%D0%B2_(%D0%9A%D0%B8%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)\" title=\"\u041a\u0438\u0440\u043e\u0432 (\u041a\u0438\u0440\u043e\u0432\u0441\u043a\u0430\u044f \u043e\u0431\u043b\u0430\u0441\u0442\u044c)\">\u041a\u0438\u0440\u043e\u0432\u0435<\/a> \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0432\u043e\u0437\u0433\u043e\u0440\u0430\u043d\u0438\u044f \u043f\u0438\u0440\u043e\u0442\u0435\u0445\u043d\u0438\u043a\u0438 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u0451\u043b \u0447\u0443\u0434\u043e\u0432\u0438\u0449\u043d\u044b\u0439 \u0432\u0437\u0440\u044b\u0432, \u0443\u043d\u0451\u0441\u0448\u0438\u0439, \u043f\u043e \u043e\u0444\u0438\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u043c \u0434\u0430\u043d\u043d\u044b\u043c, 39 \u0436\u0438\u0437\u043d\u0435\u0439. \u0412\u0441\u0435\u0433\u043e \u043f\u043e\u0441\u0442\u0440\u0430\u0434\u0430\u043b\u043e 111, \u0438\u0437 \u043d\u0438\u0445 41 \u0448\u043a\u043e\u043b\u044c\u043d\u0438\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1973\" class=\"mw-redirect\" title=\"1973\">1973<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B8%D0%B5%D0%B2\" title=\"\u041a\u0438\u0435\u0432\">\u041a\u0438\u0435\u0432\u0435<\/a> \u043d\u0430\u0447\u0430\u043b\u0441\u044f \u043f\u0435\u0440\u0432\u044b\u0439 \u0412\u0441\u0435\u0441\u043e\u044e\u0437\u043d\u044b\u0439 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u044c \u0438\u0441\u043a\u0443\u0441\u0441\u0442\u0432 \u00ab\u041a\u0438\u0435\u0432\u0441\u043a\u0430\u044f \u0432\u0435\u0441\u043d\u0430\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1977_%D0%B3%D0%BE%D0%B4_%D0%B2_%D0%BA%D0%B8%D0%BD%D0%BE\" title=\"1977 \u0433\u043e\u0434 \u0432 \u043a\u0438\u043d\u043e\">1977<\/a>&#160;\u2014 \u0432 \u043a\u0438\u043d\u043e\u0442\u0435\u0430\u0442\u0440\u0430\u0445 \u043d\u0430\u0447\u0430\u043b\u0441\u044f \u043f\u043e\u043a\u0430\u0437 \u0444\u0438\u043b\u044c\u043c\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B2%D1%91%D0%B7%D0%B4%D0%BD%D1%8B%D0%B5_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B:_%D0%AD%D0%BF%D0%B8%D0%B7%D0%BE%D0%B4_IV:_%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D0%BD%D0%B0%D0%B4%D0%B5%D0%B6%D0%B4%D0%B0_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC)\" class=\"mw-redirect\" title=\"\u0417\u0432\u0451\u0437\u0434\u043d\u044b\u0435 \u0432\u043e\u0439\u043d\u044b: \u042d\u043f\u0438\u0437\u043e\u0434 IV: \u041d\u043e\u0432\u0430\u044f \u043d\u0430\u0434\u0435\u0436\u0434\u0430 (\u0444\u0438\u043b\u044c\u043c)\">\u0417\u0432\u0451\u0437\u0434\u043d\u044b\u0435 \u0432\u043e\u0439\u043d\u044b. \u042d\u043f\u0438\u0437\u043e\u0434 IV: \u041d\u043e\u0432\u0430\u044f \u043d\u0430\u0434\u0435\u0436\u0434\u0430<\/a>\u00bb, \u0441\u0442\u0430\u0432\u0448\u0435\u0433\u043e \u043f\u0435\u0440\u0432\u044b\u043c \u043f\u043e \u0440\u0430\u0437\u043c\u0435\u0440\u0430\u043c \u043a\u0430\u0441\u0441\u043e\u0432\u044b\u0445 \u0441\u0431\u043e\u0440\u043e\u0432.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1979\" class=\"mw-redirect\" title=\"1979\">1979<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_DC-10_%D0%B2_%D0%A7%D0%B8%D0%BA%D0%B0%D0%B3%D0%BE\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 DC-10 \u0432 \u0427\u0438\u043a\u0430\u0433\u043e\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 DC-10 \u0432 \u0427\u0438\u043a\u0430\u0433\u043e<\/a>. \u041f\u043e\u0433\u0438\u0431\u043b\u0438 273 \u0447\u0435\u043b\u043e\u0432\u0435\u043a\u0430, \u0438\u0437 \u043d\u0438\u0445 \u0434\u0432\u043e\u0435&#160;\u2014 \u043d\u0430 \u0437\u0435\u043c\u043b\u0435. \u042d\u0442\u043e \u043a\u0