li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1983_%D0%B3%D0%BE%D0%B4_%D0%B2_%D0%BA%D0%B8%D0%BD%D0%BE\" title=\"1983 \u0433\u043e\u0434 \u0432 \u043a\u0438\u043d\u043e\">1983<\/a>&#160;\u2014 \u043d\u0430 \u044d\u043a\u0440\u0430\u043d\u044b \u0421\u0428\u0410 \u0432\u044b\u0448\u0435\u043b \u0444\u0438\u043b\u044c\u043c \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%B2%D1%91%D0%B7%D0%B4%D0%BD%D1%8B%D0%B5_%D0%B2%D0%BE%D0%B9%D0%BD%D1%8B._%D0%AD%D0%BF%D0%B8%D0%B7%D0%BE%D0%B4_VI._%D0%92%D0%BE%D0%B7%D0%B2%D1%80%D0%B0%D1%89%D0%B5%D0%BD%D0%B8%D0%B5_%D0%B4%D0%B6%D0%B5%D0%B4%D0%B0%D1%8F_(%D1%84%D0%B8%D0%BB%D1%8C%D0%BC)\" class=\"mw-redirect\" title=\"\u0417\u0432\u0451\u0437\u0434\u043d\u044b\u0435 \u0432\u043e\u0439\u043d\u044b. \u042d\u043f\u0438\u0437\u043e\u0434 VI. \u0412\u043e\u0437\u0432\u0440\u0430\u0449\u0435\u043d\u0438\u0435 \u0434\u0436\u0435\u0434\u0430\u044f (\u0444\u0438\u043b\u044c\u043c)\">\u0417\u0432\u0451\u0437\u0434\u043d\u044b\u0435 \u0432\u043e\u0439\u043d\u044b. \u042d\u043f\u0438\u0437\u043e\u0434 VI. \u0412\u043e\u0437\u0432\u0440\u0430\u0449\u0435\u043d\u0438\u0435 \u0434\u0436\u0435\u0434\u0430\u044f<\/a>\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1984_%D0%B3%D0%BE%D0%B4\" title=\"1984 \u0433\u043e\u0434\">1984<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_%D0%A2%D1%83-134_%D0%B2_%D0%94%D0%BE%D0%BD%D0%B5%D1%86%D0%BA%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-134 \u0432 \u0414\u043e\u043d\u0435\u0446\u043a\u0435\">\u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 \u0422\u0443-134 \u0432 \u0414\u043e\u043d\u0435\u0446\u043a\u0435<\/a>, \u043f\u043e\u0433\u0438\u0431\u043b\u0438 \u043e\u0442 4 \u0434\u043e 7 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1987\" class=\"mw-redirect\" title=\"1987\">1987<\/a>&#160;\u2014 \u0432 15 \u0447\u0