1\u0442\u0430\u043b \u0438\u043d\u0438\u0446\u0438\u0430\u0442\u043e\u0440\u043e\u043c \u0440\u0430\u0437\u0432\u043e\u0434\u0430 \u0432 \u043d\u043e\u044f\u0431\u0440\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/2002_%D0%B3%D0%BE%D0%B4\" title=\"2002 \u0433\u043e\u0434\">2002 \u0433\u043e\u0434\u0430<\/a>, \u0447\u0435\u0440\u0435\u0437 \u0442\u0440\u0438 \u043c\u0435\u0441\u044f\u0446\u0430 \u043f\u043e\u0441\u043b\u0435 \u0436\u0435\u043d\u0438\u0442\u044c\u0431\u044b \u043d\u0430 \u041f\u0440\u0435\u0441\u043b\u0438.<\/li><li>\u0411\u043e\u0441\u0442\u043e\u043d\u0441\u043a\u0430\u044f \u0435\u043f\u0430\u0440\u0445\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%BE-%D0%BA%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C\" class=\"mw-redirect\" title=\"\u0420\u0438\u043c\u0441\u043a\u043e-\u043a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u0446\u0435\u0440\u043a\u043e\u0432\u044c\">\u0420\u0438\u043c\u0441\u043a\u043e-\u043a\u0430\u0442\u043e\u043b\u0438\u0447\u0435\u0441\u043a\u043e\u0439 \u0446\u0435\u0440\u043a\u0432\u0438<\/a> \u0437\u0430\u043a\u0440\u044b\u0432\u0430\u0435\u0442 65 \u0438\u0437 357 \u043f\u0440\u0438\u0445\u043e\u0434\u043e\u0432 \u0438\u0437-\u0437\u0430 \u0441\u043d\u0438\u0436\u0435\u043d\u0438\u044f \u043f\u043e\u0441\u0435\u0449\u0430\u0435\u043c\u043e\u0441\u0442\u0438, \u043d\u0435\u0445\u0432\u0430\u0442\u043a\u0438 \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u0438\u043a\u043e\u0432 \u0438 \u043d\u0435\u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u0438 \u0435\u043f\u0430\u0440\u0445\u0438\u0438 \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u0442\u044c \u043f\u0440\u0438\u0445\u043e\u0434\u044b \u0432 \u0443\u0441\u043b\u043e\u0432\u0438\u044f\u0445 \u043d\u0435\u0434\u043e\u0441\u0442\u0430\u0442\u043a\u0430 \u0444\u0438\u043d\u0430\u043d\u0441\u0438\u0440\u043e\u0432\u0430\u043d\u0438\u044f, \u0432\u044b\u0437\u0432\u0430\u043d\u043d\u043e\u0433\u043e, \u0432 \u0447\u0430\u0441\u0442\u043d\u043e\u0441\u0442\u0438, \u043e\u0431\u0432\u0438\u043d\u0435\u043d\u0438\u044f\u043c\u0438 \u0432 \u0441\u0435\u043a\u0441\u0443\u0430\u043b\u044c\u043d\u044b\u0445 \u0434\u043e\u043c\u043e\u0433\u0430\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u0430\u0445 \u0441\u043e \u0441\u0442\u043e\u0440\u043e\u043d\u044b \u0441\u0432\u044f\u0449\u0435\u043d\u043d\u043e\u0441\u043b\u0443\u0436\u0438\u0442\u0435\u043b\u0435\u0439.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2005\" class=\"mw-redirect\" title=\"2005\">2005<\/a><ul><li>\u041d\u0430 \u044e\u0433\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u044b<\/a>&#160;\u2014 \u0438\u0437-\u0437\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D0%B0%D1%80%D0%B8%D1%8F_%D0%B2_%D1%8D%D0%BD%D0%B5%D1%80%D0%B3%D0%BE%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B5_%D0%B2_%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B5_(2005)\" title=\"\u0410\u0432\u0430\u0440\u0438\u044f \u0432 \u044d\u043d\u0435\u0440\u0433\u043e\u0441\u0438\u0441\u0442\u0435\u043c\u0435 \u0432 \u041c\u043e\u0441\u043a\u0432\u0435 (2005)\">\u0430\u0432\u0430\u0440\u0438\u0438 \u0432 \u044d\u043d\u0435\u0440\u0433\u043e\u0441\u0438\u0441\u0442\u0435\u043c\u0435<\/a> \u043d\u0430 \u044d\u043b\u0435\u043a\u0442\u0440\u043e\u043f\u043e\u0434\u0441\u0442\u0430\u043d\u0446\u0438\u0438 \u043e\u0442\u043a\u043b\u044e\u0447\u0438\u043b\u043e\u0441\u044c \u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u0442\u0432\u043e \u0432 \u0440\u044f\u0434\u0435 \u0440\u0430\u0439\u043e\u043d\u043e\u0432 \u041c\u043e\u0441\u043a\u0432\u044b, \u041f\u043e\u0434\u043c\u043e\u0441\u043a\u043e\u0432\u044c\u044f, \u0430 \u0442\u0430\u043a\u0436\u0435 \u0441\u043e\u0441\u0435\u0434\u043d\u0438\u0445 \u043e\u0431\u043b\u0430\u0441\u0442\u0435\u0439.<\/li><li>\u0412 \u0444\u0438\u043d\u0430\u043b\u044c\u043d\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D0%B8%D0%BD%D0%B0%D0%BB_%D0%9B%D0%B8%D0%B3%D0%B8_%D0%A7%D0%B5%D0%BC%D0%BF%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2_%D0%A3%D0%95%D0%A4%D0%90_2005\" class=\"mw-redirect\" title=\"\u0424\u0438\u043d\u0430\u043b \u041b\u0438\u0433\u0438 \u0427\u0435\u043c\u043f\u0438\u043e\u043d\u043e\u0432 \u0423\u0415\u0424\u0410 2005\">\u043c\u0430\u0442\u0447\u0435 \u0432 \u0421\u0442\u0430\u043c\u0431\u0443\u043b\u0435<\/a> \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B2%D0%B5%D1%80%D0%BF%D1%83%D0%BB%D1%8C_(%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BB%D1%83%D0%B1)\" title=\"\u041b\u0438\u0432\u0435\u0440\u043f\u0443\u043b\u044c (\u0444\u0443\u0442\u0431\u043e\u043b\u044c\u043d\u044b\u0439 \u043a\u043b\u0443\u0431)\">\u041b\u0438\u0432\u0435\u0440\u043f\u0443\u043b\u044c<\/a>\u00bb \u0432 \u043f\u044f\u0442\u044b\u0439 \u0440\u0430\u0437 \u0432 \u0441\u0432\u043e\u0435\u0439 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u0432\u044b\u0438\u0433\u0440\u0430\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B3%D0%B0_%D0%A7%D0%B5%D0%BC%D0%BF%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2_%D0%A3%D0%95%D0%A4%D0%90\" class=\"mw-redirect\" title=\"\u041b\u0438\u0433\u0430 \u0427\u0435\u043c\u043f\u0438\u043e\u043d\u043e\u0432 \u0423\u0415\u0424\u0410\">\u041a\u0443\u0431\u043e\u043a \u0427\u0435\u043c\u043f\u0438\u043e\u043d\u043e\u0432 \u0423\u0415\u0424\u0410<\/a>.<\/li><\/ul><\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/2009\" class=\"mw-redirect\" title=\"2009\">2009<\/a>&#160;\u2014 \u043f\u0440\u0435\u0434\u043f\u043e\u043b\u0430\u0433\u0430\u0435\u043c\u044b\u0439 \u0430\u0442\u043e\u043c\u043d\u044b\u0439 \u0432\u0437\u0440\u044b\u0432 \u0432 \u0421\u0435\u0432\u0435\u0440\u043d\u043e\u0439 \u041a\u043e\u0440\u0435\u0435. \u041f\u043e\u0434\u0437\u0435\u043c\u043d\u044b\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wik